import React from 'react';

class Body extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            name: "risa",
        }
    }
    render(){
        return(
            <div>
                <div class="title"></div>
                <div class="questions">
                    <p>注文してからどのくらいで届きますか？</p>
                    <p>送料はかかりますか？</p>
                    <p></p>
                </div>

                {this.state.name}
            </div>
        );
    }
}

export default Body;
